export default function Login() {
  return (
    <div>
      <label htmlFor="email">
        <input type="email" data-testid="email-input" />
      </label>
      <label htmlFor="email">
        <input type="password" data-testid="password-input" />
      </label>
      <button type="button" data-testid="login-submit-btn">Enter</button>
    </div>
  );
}
